@Test 
void testMaxMin2WithEmptyArray(){
 int[] result = MaxMin2.maxMin2(new int[0], 0);
 assertArrayEquals(new int[]{}, result);
}

@Test 
void testMaxMin2WithOneElementArray(){
 int[] array = new int[]{5};
 int[] result = MaxMin2.maxMin2(array, 1);
 assertArrayEquals(new int[]{5, 5}, result);
}

@Test 
void testMaxMin2WithMultipleElementsArray(){
 int[] array = new int[]{-3, -1, 0, 4};
 int[] result = MaxMin2.maxMin2(array, 4);
 assertArrayEquals(new int[]{4, -3}, result);
}

@Test 
void testMaxMin2WithNegativeValues(){
 int[] array = new int[]{-5, -10};
 int[] result = MaxMin2.maxMin2(array, 2);
 assertArrayEquals(new int[]{-5, -10}, result);
}

@Test 
void testMaxMin2WithPositiveValues(){
 int[] array = new int[]{1, 3};
 int[] result = MaxMin2.maxMin2(array, 2);
 assertArrayEquals(new int[]{3, 1}, result);
}
